SFS_df_list <- list(SFS_2, SFS_20, SFS_200, SFS_2000)
s_values_df_list <- list(s_values_2, s_values_20, s_values_200, s_values_2000)
S_means <- c(2, 20, 200, 2000)

for (dfs in c(1,2,3,4)){
  SFS <- data.frame(SFS_df_list[dfs])
  s_values <- data.frame(s_values_df_list[dfs])
  S_mean <- S_means[dfs]

colnames(SFS) <- c('freq','neutral', 'deleterious')
colnames(s_values) <- c('s')
SFS['ratio'] <- SFS$deleterious/SFS$neutral


del_SFS <- ggplot(SFS)+
  geom_bar(aes(x = freq, y = deleterious), position="dodge", stat="identity", fill = inferno(11)[2], col = "black")+
  coord_cartesian(xlim = c(1,30), ylim = c(0, 8)) + theme_classic() +xlab('Number of SNPs')+ylab('SNP frequency, deleterious')

neut_SFS <- ggplot(SFS)+
  geom_bar(aes(x = freq, y =neutral), position="dodge", stat="identity", fill = inferno(11)[5], col = "black")+
  coord_cartesian(xlim = c(1,30), ylim = c(0, 8)) + theme_classic() +xlab('Number of SNPs')+ylab('SNP frequency, neutral')

ratio_SFS <- ggplot(SFS)+
  geom_bar(aes(x = freq, y = ratio), position="dodge", stat="identity", fill = inferno(11)[8], col = "black")+
  coord_cartesian(xlim = c(1,30), ylim = c(0, 3)) + theme_classic() +xlab('Number of SNPs')+ylab('ratio')

mean_s <- round(mean(s_values$s), digits = 2)
median_s <- round(median(s_values$s), digits = 4)

s_vals <- ggplot(s_values)+
  geom_histogram(aes(x = log10(s*-1)), fill =inferno(11)[10], col = "black") +
  theme_classic()+ylab('frequency')+xlab(expression(paste(italic('s'),' values, log transformed')))+
  geom_text(x=-15, y=100, label= paste('Mean: ',mean_s)) + #adds average labels
  geom_text(x=-15, y=90, label= paste('Median: ',median_s)) + #adds median labels
  coord_cartesian(ylim = c(0, 140), xlim = c(-20, 10))

print( grid.arrange(del_SFS, neut_SFS, ratio_SFS, s_vals, top = paste("mean SD = -",S_mean*500)) )

}
